import React from "react";
import "../../Styles/Shared/Header.scss";
import MyButton from "./MyButton";

function Header() {
  return (
    <div className='header'>
      <h1>Payment Solutions. Build for Limitless Possibilities.</h1>
      <p>
        A Solution Tailored for Your Business Needs. Your Payment Tech Partner.
      </p>
      <MyButton name='Start Now' />
    </div>
  );
}

export default Header;
